import React from 'react';
import { Link } from 'react-router-dom';
import { GoogleOAuthProvider, GoogleLogin } from '@react-oauth/google';
import FacebookLogin from 'react-facebook-login';
import './Login.css';

const LoginPage = () => {
  const handleGoogleLoginSuccess = (response) => {
    console.log(response);
    // Handle Google login success
  };

  const handleGoogleLoginFailure = (response) => {
    console.log(response);
    // Handle Google login failure
  };

  const handleFacebookLogin = (response) => {
    console.log(response);
    // Handle Facebook login success
  };

  return (
    <div className="login-container">
      <div className="login-left">
        <div className="login-overlay"></div>
        <div className="login-left-content">
          <h2>Welcome back to</h2>
          <h2>Tekniksfitness</h2>
        </div>
      </div>
      <div className="login-right">
        <h2>Login</h2>
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Password" />
        <button>Login</button>
        <div className="social-login">
          <GoogleOAuthProvider clientId="YOUR_GOOGLE_CLIENT_ID">
            <GoogleLogin
              onSuccess={handleGoogleLoginSuccess}
              onFailure={handleGoogleLoginFailure}
              render={renderProps => (
                <button className="google-login" onClick={renderProps.onClick} disabled={renderProps.disabled}>
                  Login with Google
                </button>
              )}
            />
          </GoogleOAuthProvider>
          <FacebookLogin
            appId="YOUR_FACEBOOK_APP_ID"
            fields="name,email,picture"
            callback={handleFacebookLogin}
            render={renderProps => (
              <button className="facebook-login" onClick={renderProps.onClick}>
                Login with Facebook
              </button>
            )}
          />
        </div>
        <p>
          Don't have an account? <Link to="/signup">Create new</Link>
        </p>
      </div>
    </div>
  );
};

export default LoginPage;
